const useToken = {
  user1: {
    userId: "User 01",
    token: "8qlOkxz4wq",
  },
  user2: {
    userId: "User 02",
    token: "RYoOcWM4JW",
  },
};

const addHeaders = {
  headers: {
    Authorization: useToken.user1.token,
  },
};

export default addHeaders;
